import { Box, Chip, MenuItem, Select, TextField } from '@mui/material'
import React, { useState,useEffect } from 'react'
import axios from 'axios';


const TEST = () => {

const [data,setData] = useState([])


  useEffect(() => {
    let isApicancel = true

    axios.get('http://localhost/REACTJS/cognate1%20api/ProductdataAPI.php')
    .then(res=>{
      
      if (isApicancel)
      {
        setData(res.data)

      }
    
      
     })

    //  pangcancel ng reqest pag di naka open
     return () => isApicancel = false
  })

  return (
    <div>

      {data.map(e=>{
        <img
        key={e.Product_ID}
          src={e.Product_image}
         // srcSet={`${e.Product_image}?w=248&fit=crop&auto=format&dpr=2 2x`}
         // alt={e.Product_image}
           // loading="lazy"
                />
      })}




    </div>
  )
}

export default TEST
